import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
    return (

      <div className="App">
      <Header />
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hello world!!!
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}
const Header = () => {
    return (
        <div>
            <h1 style="background:blue;">It's my first app</h1>
        </div>
    );
}

export default App;
